from collections import defaultdict


def count(X, Y):
    table = defaultdict(int)
    for i, x in enumerate(X):
        for j, y in enumerate(Y):
            if x == y:
                table[(i, j)] = table[(i - 1, j - 1)] + 1
            else:
                table[(i, j)] = max(table[(i, j - 1)], table[(i - 1, j)])
    return table


def backtrack(table, X, Y, i, j):
    if i == -1 or j == -1:
        return ['']
    if X[i] == Y[j]:
        return [z + X[i] for z in backtrack(table, X, Y, i - 1, j - 1)]
    left, up = table[(i, j - 1)], table[(i - 1, j)]
    ret = []
    if left >= up:
        ret = backtrack(table, X, Y, i, j - 1)
    if up >= left:
        ret = list(set(ret) | set(backtrack(table, X, Y, i - 1, j)))
    return ret


# ref: http://en.wikipedia.org/wiki/Longest_common_subsequence_problem
def common(X, Y):
    return ','.join(sorted(
                    backtrack(count(X, Y), X, Y, len(X) - 1, len(Y) - 1)))

